import styled from 'styled-components';

export default styled.div`
  	height: 45px;
  	width: 100%;
  	top: 0;
  	position: relative;
  	display: flex;
  	flex-direction: row;

  	h1 {
  		color: #444;
  		padding-left: 50px;
  		margin-right: auto;
  		padding: 0;
  	}
`;
